                        </RadioGroup>
                      </FormControl>
                    </div>

                    <div style={{ textAlign: "left", marginTop: 10 }}>
                      <p
                        style={{
                          fontWeight: 500,
                          fontSize: 15,
                          color: "#242424",
                        }}
                      >
                        {REGI01_box1TH[5].label}
                      </p>
                      <input
                        type="text"
                        value={firstname}
                        onChange={(e) => setFirstname(e.target.value)}
